Starting from the north direction, a clockwise rotation of 2250 degrees would be equivalent to a rotation of 2250 - 1000 = 1250 degrees. Since 1250 is a multiple of 1000, it means that the skater will have completed one full rotation and will be facing the same direction as her starting position, which is north.

Therefore, the final answer is: \boxed{north}

